import React, {
    Component
} from "react";
import moment from 'moment';
import Moment from 'react-moment'; //bootstrap import
import {
    Dropdown,
    Table
} from 'react-bootstrap'; //import './App.css';
class demoTimesheet extends Component {
    constructor() {
        super();
        this.state = {
            monthObj: {
                January: 0,
                Febraury: 1,
                March: 2,
                April: 3,
                May: 4,
                June: 5,
                July: 6,
                August: 7,
                September: 8,
                October: 9,
                November: 10,
                December: 11
            },
            weekObj: [],
            tableObj: [],
            dayObj: [],
            startDate: "",
            endDate: "",
            optionItems: []
            // start : moment([2020, 8 - 1]).startOf('month'), 
            // end : moment([2020, 8 - 1]).endOf('month'), 
            // nrofWeeks : moment.duration(end - start).weeks()
        };
        //let weeks = []; 
        this.state.optionItems = Object.keys(this.state.monthObj).map(item => < Dropdown.Item onSelect = {
                () => this.onTargetSelect(this.state.monthObj[item])
            }
            eventKey = {
                this.state.monthObj.item
            } > {
                item
            } </Dropdown.Item>); console.log('this.props', this.props); } 
            onTargetSelect = function (item) 
            { this.state.weekObj = this.state.weekObj ? [] :''; let newDate = moment().year()+'-'+(item +1)+'-01'; let weeks = []; this.state.startDate = moment(''+ newDate).startOf('week').format('YYYY-MM-DD'); this.state.endDate = moment('' + newDate).endOf('month').format('YYYY-MM-DD'); console.log('weeksaaaa:', this.state.startDate,this.state.endDate );
             while (this.state.startDate <= this.state.endDate) { weeks.push(<Dropdown.Item onSelect={()=> this.selectedWeek(this.state.startDate)} eventKey={this.state.startDate}>{this.state.startDate}</Dropdown.Item > );
        this.state.startDate = moment(this.state.startDate).add(7, 'days').format('YYYY-MM-DD');
    }
    this.setState({
        weekObj:weeks
    });
}
selectedWeek = function(week) {
    console.log('ll', week)
}
handleSelect = (e) => {
    console.log(e);
    // setValue(e) 
}
render() {
        return ( <div className = "demoTimesheet" >
            <Dropdown>
            <Dropdown.Toggle variant = "success"
            id = "select-month" > Select Month 
            </Dropdown.Toggle>  
            <Dropdown.Menu > {
                this.state.optionItems
            } </Dropdown.Menu>  
            </Dropdown>  
            <Dropdown> 
                <Dropdown.Toggle variant = "success"
            id = "select-week" > Select Week 
            </Dropdown.Toggle > 
            <Dropdown.Menu> {
            this.state.weekObj
        } </Dropdown.Menu> </Dropdown > 
        <Table bordered hover > 
        <thead > 
        <tr > 
            <th > 01 - 08 - 2020 </th> 
            <th> 02-08-2020</th > 
            < th > 03 - 08 - 2020 </th> 
            <th> 04-08-2020</th > 
            < th > 05 - 08 - 2020 </th> 
            <th> 06-08-2020</th > </tr> 
            <tr> 
            <th> Monday</th > 
            < th > Tuesday </th>
             <th> Wednesday</th >
              < th > Thursday </th>
               <th> Friday</th >
                < th > Saturday </th> 
                </tr >
                 </thead> 
                 <tbody> 
                     <tr> 
                         <td> 9</td > 
                         < td > </td> 
                         <td> </td > 
                         < td > </td>
                          <td> </td > 
                          < td > </td>
                           </tr > 
                           </tbody> 
                           </Table > 
                           </div> 
                           ); 
                           }}
                           export default demoTimesheet;
